import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the Create button to open post creation modal
    await page.waitForSelector('.create-btn', { timeout: 5000 });
    await page.click('.create-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_create_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_create_modal.png'));

    // Click Select from computer button
    await page.waitForSelector('.select-computer-btn', { timeout: 5000 });
    await page.click('.select-computer-btn');

    // Set file input with a test image
    await page.waitForSelector('#fileInput', { timeout: 5000 });
    await page.setInputFiles('#fileInput', {
      name: 'test-image.jpg',
      mimeType: 'image/jpeg',
      buffer: Buffer.from('')
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_file_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_file_selected.png'));

    // Wait for caption input and add text
    await page.waitForSelector('#commentInput', { timeout: 5000 });
    await page.fill('#commentInput', 'Test post from automation');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_caption_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_caption_added.png'));

    // Click share button to publish post
    await page.waitForSelector('.share-btn', { timeout: 5000 });
    await page.click('.share-btn');

    // Wait for post to appear in feed
    await page.waitForSelector('.post', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_post_published.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_post_published.png'));

    return {
      success: true,
      action: "Successfully created and published a new post with test image and caption",
      extractedData: {
        postCount: await page.$$eval('.post', posts => posts.length),
        captionText: await page.$eval('.caption-text', el => el.textContent).catch(() => 'Not found')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete post creation task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
